INSERT INTO `anotations` VALUES (1,11,'Este é um vídeo educativo sobre estatística descritiva. Ao longo do vídeo anotações como esta serão exibidas, com tarefas que você deverá executar. Vamos começar, aperte o botão Play!','2019-04-10 17:50:53','2019-04-10 17:50:53'),(2,21,'Com base no que foi visto até então, responda a questão a seguir. Clique na marcação \"Variáveis Qualitativas\" caso queira rever essa seção do vídeo.','2019-04-10 21:55:05','2019-04-10 21:55:05'),(3,22,'Com base no que foi visto até então, responda a questão a seguir. Clique na marcação \"Variáveis Quantitativas\" caso queira rever essa seção do vídeo.','2019-04-10 21:59:07','2019-04-10 21:59:07'),(4,23,'Com base no que foi visto até então, responda a questão a seguir. Clique na marcação \"Exemplos\" caso queira rever essa seção do vídeo.','2019-04-10 21:59:48','2019-04-10 21:59:48'),(5,24,'Chegamos ao fim do experimento. Para encerrar, segue uma sequência de questões sobre o uso desta ferramenta. Agradeço a sua participação. Muito obrigado e até a próxima!','2019-04-10 22:01:02','2019-04-10 22:01:02');
